import Card from 'react-bootstrap/Card';

function Cards({ item }) {
  return (
    <div className=''>
      <Card>
      <img src={item.img} alt="" />
        <Card.Body>
          
        </Card.Body>
      </Card>
    </div>
  );
}

export default Cards;
